## Proposed changes

Make commit txn fail hint more understanable.  Classify the replicas of a tablet as follow:
1. tabletSuccReplicas:  replica write data succ, vote + 1;
2. tabletWriteFailedReplicas:   replica write data fail, vote + 0; 
3. tabletVersionFailedReplicas:  replica write data succ but privious miss version, vote + 0;

